number is divisible by 3 When this program executes, it checks each if expression in turn and executes the first body for which the condition evaluates to true. Note that even though 6 is divisible by 2, we don't see the output number is divisible by 2, nor do we see the number is not divisible by 4, 3, or 2 text from the else block. That's because Rust only executes the block for the first true condition, and once it finds one, it doesn't even check the rest. Using too many else if expressions can clutter your code, so if you have more than one, you might want to refactor your code. Chapter 6 describes a powerful Rust branching construct called match for these cases. Using if in a let Statement Because if is an expression, we can use it on the right side of a let statement to assign the outcome to a variable. fn main() { let condition = true; let number = if condition { 5 } else { 6 }; println!("The value of number is: {number}");
} The number variable will be bound to a value based on the outcome of the if expression. $ cargo run Finished dev [unoptimized + debuginfo] target(s) in 0.08s Running `target\debug\branches.exe`
The value of number is: 5 Remember that blocks of code evaluate to the last expression in them, and numbers by themselves are also expressions. In this case, the value of the whole if expression depends on which block of code executes. This means the values that have the potential to be results from each arm of the if must be the same type; the results of both the if arms and the else arm were i32 integers. If the types are mismatched, as in the following example, we'll get an error: fn main() { let condition = true; let number = if condition { 5 } else { "six" }; println!("The value of number is: {number}");
} $ cargo run Compiling branches v0.1.0 (C:\Users\jerok\projects\study_blog\rust_lang_book\code\ch03\branches)
